import React from 'react'

const SearchBar = (props) => {
    
    const [query, setQuery] = useState("")

    return (
        <>
        <input
        value={query}
        onChange={ (e) => {
            setQuery(e.target.value)
        }}
        >
        </input>        
        </>
    )
}

export default SearchBar
